package com.yskj.service;import com.yskj.dao.WorkPositionDao;import com.yskj.models.QueryParam;import com.yskj.models.WorkPosition;import com.yskj.service.base.AbstractService;import org.springframework.beans.factory.annotation.Autowired;import org.springframework.stereotype.Service;import java.util.List;@Servicepublic class WorkPositionService extends AbstractService {	@Autowired    private WorkPositionDao workPositionDao;	public WorkPositionService() {		super();	}	@Override	public WorkPositionDao getDao() {		return this.workPositionDao;	}	public List<WorkPosition> getSHPosition(QueryParam queryParam){		return this.getDao().getSHPosition(queryParam);	}}